import React from 'react'
import styled from 'styled-components'
import Axios from 'axios'

export default class AlgoPass extends React.Component {
  constructor(props) {
    super(props)
    this.state = {
      passedAlgo: {}
    }
  }

  async componentDidMount() {
    const algoId = this.props.match.params.algoId
    const {data} = await Axios.get(`/api/algos/${algoId}`)
    this.setState({
      passedAlgo: data
    })
  }

  render() {
    let algo = this.state.passedAlgo
    if (!algo) {
      return null
    }
    return (
      <Wrapper>
        <Logo>
          <img src="data:image/gif;base64," />
        </Logo>
        <Details>
          <Title>CONGRATULATIONS</Title>
          <p>You've earned {algo.algoLevel * 10} points</p>
          <Buttons>
            <a href="/algos">
              <button className="button">
                Practice More
                <span />
                <span />
                <span />
                <span />
              </button>
            </a>
            <a href="/profile">
              <button className="button">
                See Your Progress
                <span />
                <span />
                <span />
                <span />
              </button>
            </a>
          </Buttons>
        </Details>
      </Wrapper>
    )
  }
}

const Wrapper = styled.div`
  display: flex;
  flex-direction: row;
  justify-content: center;
  align-items: center;
  background: #e7e7e7;
  margin-block-start: 10px;
  padding: 10px;
  font-family: 'Open Sans', sans-serif;
`

const Details = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  background: #e7e7e7;
  font-family: 'Open Sans', sans-serif;
`

const Title = styled.h1`
  text-transform: uppercase;
  font-family: 'Open Sans', sans-serif;
  font-size: 1.4em;
`

const Buttons = styled.div`
  display: flex;
  flex-direction: row;
`
const Logo = styled.div``
